/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `product_views` (
  `product_view_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `product_id` bigint(20) unsigned NOT NULL,
  `view_count` int(11) NOT NULL DEFAULT 1,
  `last_viewed` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`product_view_id`),
  UNIQUE KEY `product_views_user_id_product_id_unique` (`user_id`,`product_id`),
  KEY `product_views_product_id_foreign` (`product_id`),
  CONSTRAINT `product_views_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`product_id`) ON DELETE CASCADE,
  CONSTRAINT `product_views_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3479 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
